import React from 'react';
import {
    Anchor,
    Box,
    Button,
    Header,
    Nav,
    Text,
} from 'grommet';
import {
    Link,
}from "react-router-dom";
import { FaPaw } from 'react-icons/fa';
import { Menu,
    User } from 'grommet-icons';


const AppHeader = ()  => {
    return(
        <Box align="center">
<Header background="light-4" pad="small">
        <Text weight="bold">Fluff Finder
        {' '}
        <FaPaw />
        </Text>
      <Nav direction="row">
          <Link to="/login">
        <User color="#5c8001" />
        </Link>
        <Link to="/signup">
        <Button label="Sign up"  color="#5c8001"/>
        </Link>
        <Menu />
      </Nav>
    </Header>  
    </Box>
    )
};

export default AppHeader;
